<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport"
    content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0" />
  <title>OL</title>
  <style>* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}
@import url("https://fonts.googleapis.com/css2?family=Inter&display=swap");

body {
  font-family: "Inter", sans-serif;
}

html,
body {
  width: 100%;
  height: 100%;
  overflow-x: hidden;
  overflow: hidden;
}
* {
  scrollbar-width: none; /* Firefox */
  -ms-overflow-style: none; /* IE 10+ */
}

/* Chrome, Safari */
*::-webkit-scrollbar {
  display: none;
}
body {
  display: flex;
  justify-content: center;
  align-items: center;
  background: rgba(252, 251, 0, 1);
}

.gradient-overlay {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 2000px; /* або скільки треба для градієнта */
  background: linear-gradient(
    to bottom,
    rgba(255, 177, 0, 1) 0%,
    rgba(252, 251, 0, 1) 100%
  );
  z-index: -1;
}

.add-container {
  position: relative;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  overflow-y: scroll;
  touch-action: pan-y;
}

.logo {
  width: 20%;
  height: auto;
  position: fixed;
  top: calc(2% + env(safe-area-inset-top));
  left: 40%;
  z-index: 2;
  opacity: 1;
  transform: translateY(-30px);
  animation: contentReveal 0.8s ease-out forwards;
  animation-delay: 1.2s;
}

.logo img {
  width: 100%;
  height: auto;
}

.check-list {
  position: relative;
  display: flex;
  flex-direction: column;
  justify-content: center;
  width: 97%;
  height: 67vh;
  top: calc(2% + env(safe-area-inset-top));
  left: 3%;
}

.check-list h2 {
  font-size: 6.5vw;
  font-weight: 900;
  text-align: center;
  margin-bottom: 1.5rem;
}

.check-list ul {
  list-style-type: disc;
  padding-left: 4.5rem;
  padding-right: 1rem;
  font-weight: 400;
  font-size: 6vw;
  line-height: 1.4;
  color: #000;
}

.check-list li {
  margin-bottom: 1rem;
}
.check-list::before {
  content: "";
  position: absolute;
  inset: 0;
  width: 100%;
  height: 100%;
  background-color: white;
  border-radius: 50px;
  z-index: -1;
}

.check-slot {
  position: absolute;
  top: 20%;
}

.scroll-content {
  position: relative;
  left: 1.5%;
  width: 97%;
  top: 4%;
  display: flex;
  flex-direction: column;
  flex-wrap: nowrap;
  justify-content: center;
  align-items: flex-start;
  gap: 15px;
  overflow-x: hidden;
}

.scroll-content img {
  width: 100%;
  height: auto;
}

.m2-3 {
  position: relative;
  width: 48%;
  display: flex;
  gap: 4%;
}

.fake-scrollbar {
  position: absolute;
  top: 0;
  right: 0px;
  width: 6px;
  height: 100%;
  background: #d9d9d9;
  z-index: 10;
}

.fake-thumb {
  width: 100%;
  background: #000; /* чорний колір як на зображенні */
  border-radius: 10px;
  position: absolute;
  top: 0;
  height: 40px;
  transition: top 0.1s;
}

/* Весь екран спочатку жовтий */
.intro-animation {
  position: fixed;
  inset: 0;
  background-color: #fcfb00; /* Жовтий фон */
  z-index: 9999;
  display: flex;
  justify-content: center;
  align-items: flex-start;
  pointer-events: none;
  transform: translateY(0);
  animation: hideIntro 0.8s ease 0.8s forwards;
}

/* Чорний прямокутник */
.black-bar {
  width: 100%;
  height: 50%;
  background-color: #000;
  transform: translateY(-100%);
  animation: dropBlack 0.8s ease-out forwards;
  animation-delay: 0.4s;
  overflow: hidden;
}

@keyframes upIntro {
  to {
    transform: translateY(-120vh);
  }
}

/* Анімація чорного блоку */
@keyframes upBlack {
  to {
    transform: translateY(-100vh);
  }
}

/* Плавне приховання intro */
@keyframes hideIntro {
  to {
    transform: translateY(120vh);
  }
}

/* Анімація чорного блоку */
@keyframes dropBlack {
  to {
    transform: translateY(100vh);
  }
}

/* Основний контент — вхід */
.add-container {
  opacity: 1;
  transform: translateY(-30px);
  animation: contentReveal 0.8s ease-out forwards;
  animation-delay: 1.2s;
}

@keyframes contentReveal {
  to {
    opacity: 1;
    transform: translateY(0);
  }
}

/* Текст — ефект з'явлення знизу */
.check-slot {
  /* Залиш без анімації */
  opacity: 1;
  transform: none;
}

.check-slot li {
  opacity: 0;
  transform: translateY(20px);
  animation: fadeInUp 0.6s ease-out forwards;
}
.check-list h2 {
  opacity: 0;
  transform: translateX(20px);
  animation: fadeh1InUp 0.6s ease-out forwards;
}

/* Плавна поява кожного li з затримкою */
.check-list h2 {
  animation-delay: 1.5s;
}

.check-slot li:nth-child(1) {
  animation-delay: 1.7s;
}
.check-slot li:nth-child(2) {
  animation-delay: 2s;
}
.check-slot li:nth-child(3) {
  animation-delay: 2.3s;
}
.check-slot li:nth-child(4) {
  animation-delay: 2.6s;
}

@keyframes fadeh1InUp {
  to {
    opacity: 1;
    transform: translateX(0);
  }
}

@keyframes fadeInUp {
  to {
    opacity: 1;
    transform: translateY(0);
  }
}
.cta-button {
  position: absolute;
  width: 70%;
  height: auto;
  left: 15%;
  top: calc(75% + env(safe-area-inset-top));
  animation: pulseCta 1s ease infinite;
  z-index: 2;
  transition: opacity 1.5s ease;
}

.cta-button img {
  width: 100%;
  height: auto;
}
@keyframes pulseCta {
  0%,
  100% {
    scale: 1;
  }
  50% {
    scale: 1.1;
  }
}

.hand {
  width: 24vw;
  height: auto;
  position: absolute;
  top: calc(85% + env(safe-area-inset-top));
  z-index: 2;
  animation: moveHand 1s ease infinite;
  pointer-events: none;
  transition: opacity 1.5s ease;
}

.hand img {
  width: 100%;
  height: auto;
}
.show {
  opacity: 1;
}
.hidden {
  opacity: 0 !important;
}
@keyframes moveHand {
  0%,
  100% {
    transform: translateY(-3vh);
  }

  50% {
    transform: translateY(0px);
  }
}
.scrolling-hand {
  width: 24vw;
  height: auto;
  position: absolute;
  top: calc(55% + env(safe-area-inset-top));
  left: 60%;
  z-index: 2;
  animation: scroll 1s ease infinite;
  pointer-events: none;
  transform-origin: center center;
  animation-delay: 2.9s;
  opacity: 0;
}

.scrolling-hand img {
  width: 100%;
  height: auto;
}

@keyframes scroll {
  0% {
    transform: translateY(5vh) rotate(300deg);
    opacity: 1;
  }

  20% {
    opacity: 1;
  }

  50% {
    transform: translateY(-15vh) rotate(360deg);
    opacity: 1;
  }

  53% {
    opacity: 0.5;
  }

  80% {
    transform: translateY(-15vh) rotate(325deg);
    opacity: 0;
  }

  100% {
    transform: translateY(5vh) rotate(300deg);
    opacity: 0;
  }
}

.video {
  position: absolute;
  width: 100%;
  height: 100vh;
  display: none;
  background-color: #fcfb00;
}

.video video {
  width: 100%;
  height: 100vh;
  object-fit: cover;
  display: block;
  color: #fcfb00;
}

@media (orientation: landscape) {
  .logo {
    width: 6%;
    left: 48%;
  }
  .check-slot {
    top: 8%;
  }
  .check-list h2 {
    font-size: 2.5vw;
    text-align: start;
    padding-left: 2.5rem;
  }
  .check-list ul {
    font-size: 2vw;
  }
  .scroll-content {
    flex-direction: row;
    flex-wrap: wrap;
  }
  .scroll-content img {
    width: calc(33.33% - 10px);
  }
  .m2-3 {
    all: unset;
    display: contents;
  }
  .cta-button {
    width: 25%;
    left: 37%;
  }
  .hand {
    width: 7vw;
  }
  .scrolling-hand {
    width: 12vw;
  }
  .gradient-overlay {
    height: 110vh;
  }
  .video {
    left: 32%;
  }
  .video video {
    width: 35%;
  }
}

@media (orientation: portrait) and (min-width: 500px) {
  .logo {
    width: 15%;
    left: 45%;
  }
  .check-list ul {
    font-size: 4vw;
    padding-left: 7.5rem;
  }
  .cta-button {
    width: 60%;
    left: 20%;
  }
  .hand {
    width: 18vw;
  }
}
@media (orientation: landscape) and (min-width: 1000px) {
  .check-list {
    height: 42vh;
  }
  .video {
    left: 22.5%;
  }
  .video video {
    width: 55%;
  }
}
</style>
</head>

let outroPlayed = false;
container.addEventListener('scroll', () => {
  const scrollTop = container.scrollTop;
  const scrollHeight = container.scrollHeight;
  const clientHeight = container.clientHeight;

  if (container && !outroPlayed && scrollTop + clientHeight >= scrollHeight - 1) {
    outroPlayed = true;
    setTimeout(() => {
      repeatAnim();
    }, 5000);

  }
});



function updateThumb() {
  const scrollHeight = container.scrollHeight;
  const containerHeight = container.clientHeight;
  const scrollTop = container.scrollTop;

  const visibleRatio = containerHeight / scrollHeight;
  const thumbHeight = Math.max(visibleRatio * containerHeight, 30);
  const thumbTop = (scrollTop / (scrollHeight - containerHeight)) * (containerHeight - thumbHeight);

  thumb.style.height = `${thumbHeight}px`;
  thumb.style.top = `${thumbTop}px`;
}

container.addEventListener('scroll', updateThumb);
window.addEventListener('resize', updateThumb);

// ініціалізувати при запуску
updateThumb();

let interacted = false;
let repeatTimeout = null;

function markInteracted() {
  if (!interacted) {
    interacted = true;

  }

  // Скидаємо попередній таймер
  if (repeatTimeout) {
    clearTimeout(repeatTimeout);
  }

  // Запускаємо новий таймер
  repeatTimeout = setTimeout(() => {

    repeatAnim();
  }, 10000);
}


["pointerdown", "keydown", "scroll", "touchstart"].forEach(event =>
  window.addEventListener(event, markInteracted)
);


window.addEventListener("load", markInteracted);

function gameCompleted() {
  parent.postMessage('complete', '*');
  console.log("Ad experience has completed");
};

function handleCTA() {
  try {
    if (typeof FbPlayableAd !== 'undefined' && FbPlayableAd.onCTAClick) {
      FbPlayableAd.onCTAClick();
      parent.postMessage('download', '*');
      gameCompleted();
      return;
    }
  } catch (e) {
    console.warn('FbPlayableAd error:', e);
  }

  if (typeof AL !== 'undefined' && AL.openStoreUrl) {
    AL.openStoreUrl();
    gameCompleted();
    return;
  }

  if (typeof mraid !== 'undefined' && mraid.open) {
    mraid.open();
    gameCompleted();
    return;
  }

  // Якщо жоден SDK не доступний
  console.log("CTA clicked — no supported SDK found.");
  parent.postMessage('download', '*');
  gameCompleted();
}

const backgroundMusic = document.getElementById('backgroundMusic');

// Зупинка аудіо
function stopAudio() {
  if (!backgroundMusic.paused) {
    backgroundMusic.pause();

  }
}

// Запуск аудіо
function startAudio() {
  if (backgroundMusic.paused) {
    backgroundMusic.play().catch(error => {
      console.error("Аудіо не може бути запущено автоматично:", error);
    });
  }
}
// Перевірка, чи елемент видно (display не none)
function isVisible(el) {
  return el && window.getComputedStyle(el).display !== 'none';
}


// Відстежуємо зміну видимості сторінки
document.addEventListener("visibilitychange", function () {
  if (document.hidden) {
    stopAudio(); // Сторінка невидима — вимикаємо музику
  } else {
    startAudio(); // Сторінка знову видима — вмикаємо музику
  }
});

// Відстежуємо, чи реклама показана
if (typeof mraid !== 'undefined') {
  // Якщо використовується MRAID
  mraid.addEventListener('ready', function () {
    mraid.addEventListener('viewableChange', function (viewable) {
      if (viewable) {
        startAudio();
      } else {
        stopAudio();
      }
    });
  });
}
// Додатково: запуск аудіо після першої взаємодії користувача
document.addEventListener('touchstart', startAudio);
document.addEventListener('scroll', startAudio);
document.addEventListener('click', startAudio);</script>
